import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import {
    ComposableMap,
    ZoomableGroup,
    Geographies,
    Geography,
} from "react-simple-maps"

class App extends Component {
    render() {
        return(
            <div>
                <ComposableMap>
                    <ZoomableGroup>
                        <Geographies geography={ "/IND_adm" }>
                        </Geographies>
                    </ZoomableGroup>
                </ComposableMap>
            </div>
        )
    }
}

export default App;
